Download our free App, log in and make payments in a smart way. The App ensures the highest level of security, therefore, PAYSTREE mobile wallet holders are presented with an extremely secure, convenient and fast way to unlock the App using a fingerprint, PIN or Mobile OTP/MAC generator (mobile token).

OTP/MAC token application
